}
ol li {
	counter-increment: my-awesome-counter;
	padding-left: 25px;
	position: relative;
}
ol li::before {
 	content: counter(my-awesome-counter) ". ";
	color: #0071bc;
	display: inline-block;
	font-size: 20px;
	font-weight: bold;
	left: 0;
